def ipow(x, p):
    ret = 1
    piv = x % mod
    while p > 0:
        if p & 1:
            ret = (ret * piv) % mod
        piv = (piv * piv) % mod
        p >>= 1
    return ret

def berlekamp_massey(x):
    ls = []
    cur = []
    lf = 0
    ld = 0
    for i in range(len(x)):
        t = 0
        for j in range(len(cur)):
            t = (t + x[i-j-1] * cur[j]) % mod
        if (t - x[i]) % mod == 0:
            continue
        if not cur:
            cur = [0]*(i+1)
            lf = i
            ld = (t - x[i]) % mod
            continue
        k = -(x[i] - t) * ipow(ld, mod - 2) % mod
        c = [0]*(i - lf - 1)
        c.append(k)
        for val in ls:
            c.append((-val * k) % mod)
        if len(c) < len(cur):
            c += [0]*(len(cur)-len(c))
        for j in range(len(cur)):
            c[j] = (c[j] + cur[j]) % mod
        if i - lf + len(ls) >= len(cur):
            ls, lf, ld = cur[:], i, (t - x[i]) % mod
        cur = c
    for i in range(len(cur)):
        cur[i] = (cur[i] % mod + mod) % mod
    return cur

def get_nth(rec, dp, n):
    m = len(rec)
    s = [0]*m
    t = [0]*m
    s[0] = 1
    if m != 1:
        t[1] = 1
    else:
        t[0] = rec[0]

    def mul(v, w):
        m = len(v)
        t_ = [0]*(2*m)
        for j in range(m):
            for k in range(m):
                t_[j+k] += v[j]*w[k]
                if t_[j+k] >= mod * mod:
                    t_[j+k] %= mod
        for j in range(2*m-1, m-1, -1):
            for k in range(1, m+1):
                t_[j-k] += t_[j]*rec[k-1]
                if t_[j-k] >= mod * mod:
                    t_[j-k] %= mod
        for j in range(m):
            t_[j] %= mod
        t_ = t_[:m]
        return t_

    nn = n
    while nn > 0:
        if nn & 1:
            s = mul(s, t)
        t = mul(t, t)
        nn >>= 1
    ret = 0
    for i in range(m):
        ret += s[i]*dp[i]
    return ret % mod

def guess_nth_term(x, n):
    if n < len(x):
        return x[n]
    v = berlekamp_massey(x)
    if not v:
        return 0
    return get_nth(v, x, n)

