def get_min_poly(n, M):
    rnd1 = []
    rnd2 = []
    random.seed(0x14004)
    for i in range(n):
        rnd1.append(random.randint(1, mod-1))
        rnd2.append(random.randint(1, mod-1))
    gobs = []
    for i_ in range(2*n+2):
        tmp = 0
        for j in range(n):
            tmp += rnd2[j]*rnd1[j]
            if tmp >= mod:
                tmp -= mod
        gobs.append(tmp % mod)
        nxt = [0]*n
        for e in M:
            nxt[e.x] += (e.v * rnd1[e.y]) % mod
            if nxt[e.x] >= mod:
                nxt[e.x] -= mod
        rnd1 = nxt

    sol = berlekamp_massey(gobs)
    sol.reverse()
    return sol

def det(n, M):
    rnd = []
    random.seed(0x14004)
    for i in range(n):
        rnd.append(random.randint(1, mod-1))
    for e in M:
        e.v = (e.v * rnd[e.y]) % mod
    sol = get_min_poly(n, M)[0]
    if n % 2 == 0:
        sol = (mod - sol) % mod
    for i in rnd:
        sol = (sol * ipow(i, mod-2)) % mod
    return sol



